'use strict';
class PLCalculationPath {
    direct;
    items;
    isDirect() {
        return this.direct;
    }
    getItems() {
        return this.items;
    }
    static create(direct, items) {
        let instance;
        instance = new PLCalculationPath();
        instance.direct = direct;
        instance.items = items;
        return instance;
    }
}
module.exports = PLCalculationPath
